import React from 'react';
import '../src/components/Header.css';
import Header from './components/Header';

function App() {
  return (
    <div className="App container">
      <Header />
      <div className="Content container">
        <p>42 is the answer to everything...</p>
      </div>
    </div>
  );
}

export default App;
